import React from 'react';
import '../styles/neomorph.css';

const Rewards = ({ points, onRedeem }) => {
    return (
        <div className="neomorph-card" style={{ textAlign: 'center' }}>
            <h3>Puntos: {points}</h3>
            <button className="neomorph-button" onClick={onRedeem}>Canjear Recompensas</button>
        </div>
    );
};

export default Rewards;
